import React from "react";
import ReactDOM from 'react-dom'
import {responsive} from './responsive.js'
import {Main} from './index.js'
import accountimg from './account.png'
import { Track_progress } from "./Track_progress.js";
export class Heading extends React.Component{
    constructor(){
        super()
        this.state={flag:false,style:responsive.heading.main(),h1:responsive.heading.exit(),account:responsive.heading.account(accountimg),box:responsive.heading.header_box(),
        header_button:responsive.heading.header_button()}
        this.resize=this.resize.bind(this);
        window.addEventListener('resize',()=>this.resize(true));
       // window.addEventListener('click',()=>this.resize(true));
    }
    resize(t){
        if(t)
        {
        this.setState((prev)=>{return {flag:false,style:responsive.heading.main(),h1:responsive.heading.exit(),account:responsive.heading.account(accountimg)}});
        return;
        }
        if(this.state.flag)
        this.setState((prev)=>{return {flag:false,style:responsive.heading.main(),h1:responsive.heading.exit(),account:responsive.heading.account(accountimg)}});
        else
        this.setState((prev)=>{return {flag:true,style:responsive.heading.main(),h1:responsive.heading.exit(),account:responsive.heading.account(accountimg)}});

    }
    render(){
        return(
            <div style={this.state.style}>
            <button style={this.state.h1}onClick={()=>{ReactDOM.render(<Main logged_in={true}/>,document.getElementById('root'))}}>
                Binary.c
            </button>
            <div style={this.state.box}>
                <button style={this.state.header_button} onClick={()=>{ReactDOM.render(<Track_progress/>,document.getElementById('root'))}}>Progress</button>
                <button style={this.state.header_button} onClick={this.props.logout}> Sign Out</button>
                <button style={this.state.header_button}> Account</button>
            </div>
            <button style={this.state.account} onClick={()=>this.resize(false)}>
                {this.state.flag &&
                <Account_info logout={this.props.logout}/>
                }
            </button>
            <hr/>
            </div>
        )
    }
}
class Account_info extends React.Component{
    constructor(){
        super()
        this.state={style:responsive.heading.account_info(),sub:responsive.heading.account_sub()}
    }
    render(){
        return<div style={this.state.style}>
            <button style={this.state.sub} onClick={()=>{ReactDOM.render(<Track_progress/>,document.getElementById('root'))}}> Track Progress</button>
            <button style={this.state.sub}>Account</button>


            <button style={this.state.sub}>Settings</button>


            <button style={this.state.sub}>About</button>

            <button style={this.state.sub} onClick={this.props.logout}>Sign Out</button>

        </div>
    }
}
